import React from 'react';


function Header() {
    return (
      <><header>
        <h1>URL Shortener</h1>
      </header><ul align='right'>
          <a href="/">Home </a>
          <a href="/user/login"> Login </a>
          <a href="/user/signup"> Signup </a>
        </ul></>



    );
  }

  export default Header;
